import LogCliente from './pages/login/login_cliente'
import LogAdmin from './pages/login/login_admin'
import Register from './pages/login/Register_cliente'
import Inicio from './pages/inicio'
import InicioAdmin from './pages/inicio_admin'
import AdminHoteles from './pages/admin_hoteles'
import AdminClientes from './pages/admin_clientes'
import Reservar from './pages/reservar'
import Cuenta from './pages/cuenta'
import ReservasCliente from './pages/reservas_cliente'
import InsertHoteles from './pages/insert_hoteles'
import VerHoteles from './pages/ver_hoteles'
import VerReservas from './pages/ver_reservas'
import VerClientes from './pages/ver_clientes'
import EditarHoteles from './pages/editar_hoteles'
import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import { AuthProvider } from './pages/login/auth';
import AdminInfra from './pages/admin_infra'

function App() {

    const Admin = () => {
        if (isLoggedCliente){
          swal.fire ({
            customClass: {
              popup: 'popup-custom',
              confirmButton: 'confButton-custom'
            },
            title: "Ingresa como admin",
            //html: '<div><p class="textAlert">Los clientes no pueden acceder al area de administracion, por lo que deberas cerrar la sesion del usuario actual e ingresar como un usuario administrador. A continuacion puedes cerrar sesion y seras redirigido al login de administrador o puedes continuar como usuario regular.</p></div>',
            text:"Los clientes no pueden acceder a el area de administracion, por lo que deberas cerrar la sesion del usuario actual e ingresar como un usuario administrador. A continuacion puedes cerrar sesion y seras redirigido al login de administrador o puedes continuar como usuario regular haciendo click por fuera del recuadro.",
            confirmButtonText: 'Ingresar como admin',
            icon: "warning",
            padding: "20px",
            timerProgressBar: "true",
            allowOutsideClick: "true"
          }).then(response => {
            if(response.isConfirmed){
              logout();
              window.location.href = '/login-admin';
            }
          });
        }
        else if (!isLoggedAdmin) {
          window.location.href = '/login-admin';
        }
        else
        {
          window.location.href = '/admin';
        }
      }

      const Cuenta = () => {
        if (isLoggedAdmin || isLoggedCliente) {
          window.location.href = '/cuenta';
        }
        else
        {
          window.location.href = '/login-cliente'
        }
      }


    return (
        <div>
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/materialize/1.0.0/css/materialize.min.css" />
            <div className="header-content">
            <div className="cuenta-button-container">
                <button className="cuenta-button" onClick={Cuenta}>
                Tu Cuenta
                </button>
            </div>
            <div className="admin-button-container">
                <button className="admin-button" onClick={Admin}>
                Admin
                </button>
             </div>
            </div>
            <Router>
                <AuthProvider>
                    <Routes>
                        <Route path='/' element={<Inicio />}></Route>
                        <Route path='/admin' element={<InicioAdmin />}></Route>
                        <Route path='/login-cliente' element={<LogCliente />}></Route>
                        <Route path='/login-admin' element={<LogAdmin />}></Route>
                        <Route path='/register' element={<Register />}></Route>
                        <Route path='/administrar-hoteles' element={<AdminHoteles />}></Route>
                        <Route path='/administrar-clientes' element={<AdminClientes />}></Route>
                        <Route path='/reservar/:hotelId' element={<Reservar />}></Route>
                        <Route path='/cuenta' element={<Cuenta />}></Route>
                        <Route path='/reservas-cliente' element={<ReservasCliente />}></Route>
                        <Route path='/agregar-hoteles' element={<InsertHoteles />}></Route>
                        <Route path='/ver-hoteles' element={<VerHoteles />}></Route>
                        <Route path='/ver-reservas' element={<VerReservas />}></Route>
                        <Route path='/ver-clientes' element={<VerClientes />}></Route>
                        <Route path='/hotel/edit/:id' element={<EditarHoteles />}></Route>
                        <Route path='/insfraestructura' element={<AdminInfra />}></Route>
                    </Routes>
                </AuthProvider>
            </Router>
        </div>
    )
}

export default App;


